import React, { Component } from "react";
import { BrowserRouter as Router } from "react-router-dom";
import Header from "./components/header.jsx";
import NavBar from "./components/navBar.jsx";
import StudentInfo from "./components/studentInfo.jsx";
import Footer from "./components/footer.jsx";
import CourseList from "./components/courseListPage.jsx";
import About from "./components/about.jsx";
import NotFound from "./components/notFound.jsx";
import AdvisorInformation from "./components/contactAdvisor.jsx";
import { Switch, Route, Redirect } from "react-router-dom";

class StudentHome extends Component {
  render() {
    return (
      <React.Fragment>
        <Header />

        <NavBar />
        <Router>
          <Switch>
            <Route path="/courseList" component={CourseList}></Route>
            <Route
              path="/advisorInformation"
              component={AdvisorInformation}
            ></Route>
            <Route path="/about" component={About}></Route>
            <Route path="/" exact component={StudentHome}></Route>
          </Switch>
        </Router>
        <StudentInfo />
        <Footer />
      </React.Fragment>
    );
  }
}

export default StudentHome;
